import React from "react";
import "../App.css";
import "./HeroSection.css";

function HeroSection() {
    return (
        <div className="hero-container">
            <img className=".hero-picture" src="images/losangeles.jpeg" alt="" />
            <p>LET GROW YOUR BACK OFFICE WHILE YOU GROW YOUR BUSINESS</p>
        </div>
    )
}

export default HeroSection;
